	public class ModelRepository : IRepositoryModel
	{
		public ModelRepository()
		{
		}

		public async Task<Model> GetByIdAsync(int id)
		{
			var Model = await App.DataBase.connect.Table<Model>().Where(b => b.Id == id).FirstOrDefaultAsync();
			await App.DataBase.connect.CloseAsync();
			return Model;
		}

		public async Task<List<Model>> GetAllAsync(bool forceRefresh = false)
		{
			var models = await App.DataBase.connect.Table<Model>().ToListAsync();
			await App.DataBase.connect.CloseAsync();
			return models;
		}

		public async Task<List<Model>> GetByBrandIdAsync(int brandId)
		{
			var Models = await App.DataBase.connect.Table<Model>().Where(b => b.IdBrand == brandId).OrderBy(b => b.Name).ToListAsync();
			await App.DataBase.connect.CloseAsync();
			return Models;
		}

